body {
    font-family: system-ui;
}

/* List View */

/* Put task content and meta on same line */
.task_list_item .task_list_item__content {
    display: flex;
    justify-content: space-between;
}

/* Remove subtasks, projects, comments and reminders info from list view
- span: subtasks, projects
- a: comments, reminders
- button: due date*/
.task_list_item .task_list_item__content > div:nth-child(2) > *:not(button) {
    display: none;
}

/* Task content should not show in more than one line */ 
.task_list_item .task_list_item__content .task_list_item__content__wrapper .task_content {
    -webkit-line-clamp: 1;
}

/* Remove task description */
.task_list_item .task_list_item__content .task_list_item__content__wrapper .task_description {
    display: none;
}
